import 'bootstrap/dist/css/bootstrap.min.css';
import required_ics from '../assets/icsrequirements';


const Requirements = () => {
    for (var key in required_ics)
    {
        console.log(key, required_ics[key])
    }

    return (
        <ul>
            {required_ics.map((key, value) =>
            (
                <li>{key}</li>
            )
            )}

        </ul>
    )
}

export default Requirements
